import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

function MyApp() {
  return (
    <ul>
      <li>Apples</li>
      <li>Bananas</li>
      <li>Peaches</li>
    </ul>
  );
}

ReactDOM.render(
  <div>

  </div>, document.getElementById("root")
);

